import React, { useEffect, useState } from 'react';
import axios from 'axios';

function BoardList() {
    const [list, setList] = useState([]);
    useEffect(()=> {
        axios.get('/api/board/list').then((res)=>{
            setList(res.data)
        })
    },[])
    return(
    <div>
        {
            list.map(function(a, i) {
                return (
                <>
                    <tr>
                        <div>
                            <div>글쓴이{list[i].name}</div>
                            <div>제목{list[i].title}</div>
                            <div>사용 기술{list[i].skill_stack}</div>
                            <div>분야{list[i].work_field}</div>
                            <div>정원{list[i].max_people}</div>
                            <div>마감일{list[i].end_date}</div>
                            <div>-----------</div>
                        </div>
                    </tr>
                </>
                )
            })
        }
    </div>
    );
}
export default BoardList;
